import React, { Component } from 'react'

export default class Dropdown extends Component {
    render() {
        return (
            <div>
                <label className='form__label' htmlFor="category">Category</label>
                <select name='category' className='form__dropdown' onChange={(e)=>this.props.handleChange(e)}>
                    {this.props.options.map(o => <option value={o}>{o}</option>)}
                </select>
            </div>
        )
    }
}
